import React, { useState } from 'react';
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from "../src/pages/Home";

function App() {


    return (
        <Router>
            <Navbar />
            <Switch>
                <Route path='/' exact>
                    <Home />
                </Route>
            </Switch>
        </Router>
    );
}

export default App;
